import React, { useState, useEffect } from "react";

interface StockItem {
  id: number;
  name: string;
  quantity: number;
  lastUpdated: string;
  expirationDate: string;
}

interface Movement {
  id: number;
  itemName: string;
  type: string;
  quantity: number;
  date: string;
}

const ClinicManagement: React.FC = () => {
  const [stockItems, setStockItems] = useState<StockItem[]>([]);
  const [expiredItemsCount, setExpiredItemsCount] = useState<number>(0); // Contador de itens vencidos
  const [movementHistory, setMovementHistory] = useState<Movement[]>([]);

  useEffect(() => {
    // Aqui você fará uma chamada à API para obter os itens em estoque e o histórico de movimentações
    // Por enquanto, usaremos dados de exemplo
    const sampleStockItems: StockItem[] = [
      {
        id: 1,
        name: "Amoxicilina",
        quantity: 100,
        lastUpdated: "18-03-2024",
        expirationDate: "20-12-2024",
      },
      {
        id: 2,
        name: "Neosaldina",
        quantity: 50,
        lastUpdated: "17-03-2024",
        expirationDate: "01-07-2024",
      },
      // Outros itens em estoque...
    ];

    const sampleMovementHistory: Movement[] = [
      {
        id: 1,
        itemName: "Amoxicilina",
        type: "Entrada",
        quantity: 50,
        date: "20-03-2024",
      },
      {
        id: 2,
        itemName: "Neosa",
        type: "Saída",
        quantity: 20,
        date: "22-03-2024",
      },
      // Outros registros de movimentações...
    ];

    // Atualizar o contador de itens vencidos
    const now = new Date();
    const expiredItems = sampleStockItems.filter(
      (item) => new Date(item.expirationDate) < now
    );
    setExpiredItemsCount(expiredItems.length);

    setStockItems(sampleStockItems);
    setMovementHistory(sampleMovementHistory);
  }, []);

  // Aqui você pode implementar funções para adicionar, remover ou atualizar itens em estoque

  // Função para calcular a quantidade total de itens em estoque
  const getTotalStock = () => {
    return stockItems.reduce((total, item) => total + item.quantity, 0);
  };

  return (
    <div>
      <h2>Gestão da Clínica</h2>
      <h3>Controle de Estoque</h3>
      <p>Total de Itens em Estoque: {getTotalStock()}</p>
      <p>Itens Vencidos: {expiredItemsCount}</p>
      <table>
        <thead>
          <tr>
            <th>Item</th>
            <th>Quantidade</th>
            <th>Última Atualização</th>
            <th>Data de Validade</th>
          </tr>
        </thead>
        <tbody>
          {stockItems.map((item) => (
            <tr
              key={item.id}
              className={
                new Date(item.expirationDate) < new Date() ? "expired" : ""
              }
            >
              <td>{item.name}</td>
              <td>{item.quantity}</td>
              <td>{item.lastUpdated}</td>
              <td>{item.expirationDate}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <h3>Histórico de Movimentações</h3>
      <table>
        <thead>
          <tr>
            <th>Tipo</th>
            <th>Item</th>
            <th>Quantidade</th>
            <th>Data</th>
          </tr>
        </thead>
        <tbody>
          {movementHistory.map((movement) => (
            <tr key={movement.id}>
              <td>{movement.type}</td>
              <td>{movement.itemName}</td>
              <td>{movement.quantity}</td>
              <td>{movement.date}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ClinicManagement;
